import React from 'react';
import Navigation from '../components/Navigation';
import Persons from '../components/Persons';
import Title from '../components/Title';

const Favoris = () => {
    return (
        <div>
            <Title />
            <Navigation />
            <Persons />
            <h1>Favorite Cards below !</h1>
        </div>
    );
};

export default Favoris;
